import React from 'react';
import './Style.css';

function Navbar() {
  return (
    <nav className='navbar'>
        <button id="Home_btn" className="nav_btn"><b>Home</b></button>
        <button id="Home_btn" className="nav_btn"><b>Watch List</b></button>
        <button id="Home_btn" className="nav_btn"><b>More</b></button>

    </nav>
  );
}

export default Navbar;
